import Icon from "react-native-vector-icons/Ionicons";
import axios from "axios";
import * as ImageManipulator from "expo-image-manipulator";
import { NavigationActions, StackActions } from "react-navigation";

class EditImageScreen extends React.Component {
  static navigationOptions = {
    headerShown: false,
    headerBackground: () => null,
    headerMode: null,
    headerTitle: () => null,
  };

  async uploadImageAsync(uri) {
    const storedAge = await AsyncStorage.getItem("@myApp:age");
    const storedHeight = await AsyncStorage.getItem("@myApp:height");
    const storedWeight = await AsyncStorage.getItem("@myApp:weight");
    const storedGender = await AsyncStorage.getItem("@myApp:gender");
    const storedEthnicity = await AsyncStorage.getItem("@myApp:ethnicity");
    const image = await AsyncStorage.getItem("@myApp:Image");

    let afterUri;

    // value that cause an default error
    let afterBase64 =
      "data:image/jpeg;base64,";
    // let afterBase64 = "data:image/jpeg;base64,";
    let imageResult;
    await ImageManipulator.manipulateAsync(uri, [{ resize: { width: 500 } }], {
      compress: 0,
      base64: true,
    })
      .then(function (object) {
        imageResult = object;
        afterUri = object.uri;
        // replace with new value, really value,  not error
        afterBase64 = "data:image/jpeg;base64," + object.base64;
      })
      .catch(function (error) {
        alert("An error has occurred: " + error);
      });

    // let apiUrl = 'http://35.194.76.108:8000/api/face_align/';
    let apiUrl = "http://192.168.2.49:8000/api/face_align/";

    var formdata = new FormData();

    formdata.append("is_regular_input", true);
    formdata.append("height", "MjI=");
    formdata.append("weight", "MjI=");
    // formdata.append('gender', 'MjI=');
    // ethnicity is not put into consideration yet! The feature is not yet developed.
    formdata.append("ethnicity", "d2hpdGU=");
    formdata.append("age", "MjI=");

    // formdata.append('image', image);
    formdata.append("image", afterBase64);
    await axios({
      method: "post",
      contentType: "multipart/form-data",
      url: apiUrl,
      data: formdata,
    })
      .then(function (response) {
        let json = JSON.parse(JSON.stringify(response.data));
        AsyncStorage.setItem(
          "@myApp:api_returned_bulb_size",
          base64.decode(json.data.bulb_size)
        );
        alert(
          "The Bulb size of recommended Pacibabyr is: " +
            base64.decode(json.data.bulb_size)
        );
        alert(
          "The Shield Type of recommended Pacibabyr is: " +
            base64.decode(json.data.shield_type)
        );
        AsyncStorage.setItem(
          "@myApp:api_returned_shield_type",
          base64.decode(json.data.shield_type)
        );
        console.log(json);
      })
      .catch(function (error) {
        alert("Please take a picture with the baby's face clearly.");
        console.log(JSON.stringify("Skyangman res Error : " + error));
        console.log(error.response.request._response);
      });
  }

  changeTab() {
    this.props.navigation.popToTop();
    this.props.navigation.navigate("LoadingScreen", {});
  }

  render() {
    return (
      <View>
        <ImageZoom
          cropWidth={Dimensions.get("window").width}
          cropHeight={Dimensions.get("window").height}
          imageWidth={Dimensions.get("window").width}
          imageHeight={Dimensions.get("window").height}
          //   horizontalOuterRangeOffset={(range) => console.log(range)}
          //   onMove={(val) => console.log("dragged", val)}
        >
          <Image
            style={{
              width: Dimensions.get("window").width,
              height: Dimensions.get("window").height,
              zIndex: 99,
            }}
            source={{
              uri: this.props.navigation.getParam("imageURI"),
              isStatic: true,
            }}
          />
        </ImageZoom>

        <View style={styles.circleAlign}>
          <View style={styles.circle} />
        </View>

        <View style={styles.container}>
          <View style={styles.buttonFirstRow}>
            <View style={styles.buttonBackContainer}>
              <Icon
                raised
                name="ios-arrow-dropleft-circle"
                size={60}
                color="#d0caca"
                onPress={() => this.props.navigation.goBack()}
              />
            </View>
            <View style={styles.buttonBackContainer}>
              <Icon
                raised
                name="ios-arrow-dropright-circle"
                size={60}
                color="#42B6C7"
                onPress={async () => {
                  // alert(this.props.navigation.getParam('imageURI'))
                  await this.uploadImageAsync(
                    this.props.navigation.getParam("imageURI")
                  ).then(
                    this.changeTab()
                    // this.props.navigation.navigate('LoadingScreen')
                  );
                }}
              />
            </View>
          </View>
        </View>
      </View>
    );
  }
}

